CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "lots_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "lots_lease" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "monthly_rental_amount" integer NOT NULL, "due_date" smallint unsigned NOT NULL CHECK ("due_date" >= 0), "grace_period" smallint unsigned NOT NULL CHECK ("grace_period" >= 0), "lease_agreement_path" varchar(100) NOT NULL, "lot_image_path" varchar(100) NOT NULL, "lease_holder_id" bigint NOT NULL REFERENCES "lots_leaseholder" ("id") DEFERRABLE INITIALLY DEFERRED, "lot_id" bigint NOT NULL REFERENCES "lots_lot" ("id") DEFERRABLE INITIALLY DEFERRED, "last_payment_date" date NULL, "last_payment_date_id_id" bigint NULL REFERENCES "lots_payment" ("id") DEFERRABLE INITIALLY DEFERRED, "payment_status" varchar(20) NOT NULL);
